import './App.css';
import ListInvestmentComponent from './components/ListInvestmentComponent';
import HeaderComponent from './components/Header/HeaderComponent';
import { BrowserRouter as Router, Navigate, Route } from "react-router-dom";
import Topbar from './components/Header/HeaderComponent';

function App() {
  return (

    <div>
      <Router>
      <Topbar />
      <div className="container">
        <Navigate>
          localhost:3000/
          <Route path='/' component = {ListInvestmentComponent}></Route>
          <Route path='/investments' component = {ListInvestmentComponent}></Route>


        </Navigate>
      <ListInvestmentComponent />
      </div>
      </Router>
    </div>


  );
}

export default App;
